import logo from '../images/logo.png'
const Header = () => {
    return ( 
        <header>
            <nav className='nav'>
                <img src={logo} alt="logo" />
                <a href="TradingPage.js"><button className='btn-primary'>Launch App</button></a>
            </nav>
        </header>
    );
}

export default Header;
